/** @format */

import React from "react";
import { useDispatch } from "react-redux";
import { Button, Card, Col, Row } from "react-bootstrap";
import {
  activateForm,
  activateUrl,
  deactivateUrl,
} from "../../slices/form.slice";
import { ButtonGroupContainer } from "./getting-started.styles";

const GettingStarted = () => {
  const dispatch = useDispatch();
  return (
    <Row className="justify-content-center">
      <Col md={4}>
        <Card className="text-center">
          <Card.Header>Getting Started</Card.Header>
          <Card.Body>
            <Card.Title>Create A New Recipe</Card.Title>
            <Card.Text>
              With supporting text below as a natural lead-in to additional
              content.
            </Card.Text>

            <Button
              variant="outline-primary"
              onClick={() => {
                dispatch(activateForm());
                dispatch(activateUrl());
              }}
            >
              From allrecipes.com
            </Button>
            <Button
              variant="outline-dark"
              onClick={() => {
                dispatch(activateForm());
                dispatch(deactivateUrl());
              }}
            >
              From scratch
            </Button>
          </Card.Body>
        </Card>
      </Col>
    </Row>
  );
};

export default GettingStarted;
